#import "ESCSpeedyDesktopManager.h"
#import "Base64.h"
#import "HTTPServer.h"
#import "DDLog.h"
#import "DDTTYLogger.h"

@interface ESCSpeedyDesktopManager ()

@property(nonatomic,copy)NSString* webRootDir;

@property(nonatomic,copy)NSString* mainPage;

@property (nonatomic,strong)HTTPServer *httpServer;

@end

static ESCSpeedyDesktopManager *staticSpeedyDesktopManager;

@implementation ESCSpeedyDesktopManager

+ (instancetype)sharedSpeedyDesktopManager {
    static dispatch_once_t onceToken;
    dispatch_once(&onceToken, ^{
        staticSpeedyDesktopManager = [[ESCSpeedyDesktopManager alloc] init];
    });
    return staticSpeedyDesktopManager;
}

- (void)dealloc
{
    // 停止服务
    [_httpServer stop];
}

+ (BOOL)creatSpeedyDesktopWithImage:(UIImage *)image title:(NSString *)title  appURLSchemes:(NSString *)appURLSchemes {
    
    [DDLog addLogger:[DDTTYLogger sharedInstance]];
    [ESCSpeedyDesktopManager sharedSpeedyDesktopManager].httpServer = [[HTTPServer alloc] init];
    [[ESCSpeedyDesktopManager sharedSpeedyDesktopManager].httpServer setType:@"_http._tcp."];
    
    //启动本地httpSever和服务器首页页面
    NSArray *paths = NSSearchPathForDirectoriesInDomains(NSCachesDirectory, NSUserDomainMask, YES);
    NSString *documentsPath = paths[0];
    NSString* webRootDir = [documentsPath stringByAppendingPathComponent:@"web"];
    BOOL isDirectory = YES;
    BOOL exsit = [[NSFileManager defaultManager] fileExistsAtPath:webRootDir isDirectory:&isDirectory];
    if(!exsit){
        [[NSFileManager defaultManager] createDirectoryAtPath:webRootDir withIntermediateDirectories:YES attributes:nil error:nil];
    }
    NSString* mainPage = [NSString stringWithFormat:@"%@/web/index.html",documentsPath];
    
    
    BOOL result = [[ESCSpeedyDesktopManager sharedSpeedyDesktopManager] writeToFile:mainPage image:image title:title appURLSchemes:appURLSchemes];
    if (result == NO) {
        return NO;
    }
    
    [[ESCSpeedyDesktopManager sharedSpeedyDesktopManager].httpServer setDocumentRoot:webRootDir];
    
    return [[ESCSpeedyDesktopManager sharedSpeedyDesktopManager] startServer];
}

- (BOOL)startServer {
    [_httpServer stop];
    // Start the server (and check for problems)
    NSError *error;
    if([_httpServer start:&error]) {
        NSString *urlStrWithPort = [NSString stringWithFormat:@"http://localhost:%d",[_httpServer listeningPort]];
        [[UIApplication sharedApplication] openURL:[NSURL URLWithString:urlStrWithPort]];
        return YES;
    }
    else {
        NSLog(@"startserver error = %@",error);
        return NO;
    }
}

- (BOOL)writeToFile:(NSString *)path image:(UIImage *)image title:(NSString *)title  appURLSchemes:(NSString *)appURLSchemes{
    NSData* imageData = UIImagePNGRepresentation(image);
    NSString* imageDataBase64Str = [imageData base64EncodedString];
    
    NSString* contentStr = [NSString stringWithFormat:@"<!DOCTYPE html>\n<html>\n<head>\n<meta name=\"apple-mobile-web-app-capable\" content=\"yes\">\n<meta name=\"apple-mobile-web-app-status-bar-style\" content=\"black\">\n<meta content=\"text/html charset=UTF-8\" http-equiv=\"Content-Type\" />\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0, user-scalable=no\" />\n<link rel='apple-touch-icon' href='data:image/png;base64,%@'>\n<title>%@</title>\n</head>\n<body bgcolor=\"#ffffff\">\n<a href=\"%@\" id=\"qbt\" style=\"display: none\"></a>\n<span id=\"msg\"></span>\n</body>\n<script>\nif (window.navigator.standalone == true)\n{\nvar lnk = document.getElementById(\"qbt\")\nvar evt = document.createEvent('MouseEvent')\nevt.initMouseEvent('click')\nlnk.dispatchEvent(evt)\n}\nelse\n{\ndocument.getElementById(\"msg\").innerHTML='<div style=\"font-size:12px;\"> <img width=\"360px\" height=\"640px\" id=\"i\" src=\"data:image/png;base64,\"></div>'\n}\n</script>\n</html>",imageDataBase64Str,title,appURLSchemes];
    
    NSString* contentStrBase64 = [contentStr base64EncodedString];
    
    contentStr = [contentStrBase64 stringByReplacingOccurrencesOfString:@"+" withString:@"%2B"];
    contentStr = [contentStr stringByReplacingOccurrencesOfString:@"=" withString:@"%3D"];
    contentStr = [contentStr stringByReplacingOccurrencesOfString:@"/" withString:@"%2F"];
    
    NSString* htmlStrBase64 = [NSString stringWithFormat:@"<!DOCTYPE html>\n<html>\n<head lang=\"en\">\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\">\n<meta http-equiv=\"refresh\" content=\"1; data:text/html;charset=utf-8;base64,%@\">\n</head>\n<body>\n</body>\n</html>",contentStr];
    NSData *data = [htmlStrBase64 dataUsingEncoding:NSUTF8StringEncoding];
    return [data writeToFile:path atomically:YES];
}

@end
